import React from 'react'
import ReactDom from 'react-dom';
const MainLayout = () => {
    return (
        
        
        <div className="main-layout">
           
        <div className="row" className="RemoveDiv">
        <div className="col-sm-6">
        <img src="https://cdn.pixabay.com/photo/2015/04/23/22/00/tree-736885__340.jpg" className="icon1" />
        </div>
        <div className="col-sm-6">
        <img src="https://cdn.pixabay.com/photo/2015/04/23/22/00/tree-736885__340.jpg" className="icons"/>
        </div>
        
        </div>
        
        
        
        </div>
        
        
    );
}

export default MainLayout;
